//import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View } from "react-native";

import { NativeRouter, Route, Link } from "react-router-native";

import Login from "./Login/Login.js";
import Leaderboard from "./Profile/Leaderboard.js";
import Analytics from "./Profile/Analytics.js";

export default function App() {
  return (
    // <View style={styles.container}>
    //   <Text>Open up App.js to start working on your app!</Text>
    //   <StatusBar style="auto" />
    // </View>
    <NativeRouter>
      <View style={styles.container}>
        <View style={styles.nav}>
          <Link to="/" underlayColor="#f0f4f7" style={styles.navItem}>
          </Link>
          <Link to="/leaderboard" underlayColor="#f0f4f7" style={styles.navItem}>
          </Link>
          <Link to="/analytics" underlayColor="#f0f4f7" style={styles.navItem}>
          </Link>
        </View>

        <Route path="/" component={Login} />
        <Route path="/leaderboard" component={Leaderboard} />
        <Route path="/analytics" component={Analytics} />
      </View>
    </NativeRouter>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
